ong>kleineren Pixeln</strong> erzeugen.</p>\\n\\n<p>Die post-processing Software fr <strong>CPR-Rekonstruktionen</strong>haben dann aber meist Probleme Koronarien und anderen Strukturen <strong>automatisch</strong> zu erkennen, sodass das<strong> manuell</strong> erfolgen msste.</p>\\n\\n<p>Deshalb ist der <strong>bessere </strong>Weg die Bildmatrix zu <strong>vergrern </strong>(bspw. auf 1024px x 1024px). Dadurch wird lediglich die <strong>Rekonstruktionszeit</strong> verlngert.</p>\\n\\n<p></p>\\n\\n<p></p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"71851199-89a7-46f6-8554-6effd81e86f4\"}]},{\"position\":{\"x\":76.8,\"y\":53.32596340598147},\"alwaysFullscreen\":true,\"content\":[{\"params\":{\"decorative\":false,\"contentName\":\"Image\",\"expandImage\":\"Expand Image\",\"minimizeImage\":\"Minimize Image\",\"alt\":\"Groes FOV\",\"title\":\"Durch die groen Pixel (0.5 mm) verliert man Bildinformation. Durch sekundre CPR-Rekonstruktionen auf diesen Bildern, wird dieser Effekt noch verstrkt.\",\"file\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAgAAAAEUCAYAAABd147qAAABhWlDQ1BJQ0MgcHJvZmlsZQAAKJF9kT1Iw0AcxV/TSkVaHewg4hCw6mJBVMRRq1CECqVWaNXB5NIPoUlDkuLiKLgWHPxYrDq4OOvq4CoIgh8gzg5Oii5S4v+SQosYD4778e7e4+4dINTLTDUDY4CqWUY6ERezuRUx+IoAwujGCAYlZuqzqVQSnuPrHj6+3sV4lve5P0dYyZsM8InEM0w3LOJ14qlNS+e8TxxhJUkhPiceNeiCxI9cl11+41x0WOCZESOTniOOEIvFNpbbmJUMlXiSOKqoGuULWZcVzluc1XKVNe/JXxjKa8tLXKc5gAQWsIgURMioYgNlWIjRqpFiIk37cQ9/v+NPkUsm1wYYOeZRgQrJ8YP/we9uzcLEuJsUigMdL7b9MQQEd4FGzba/j227cQL4n4ErreWv1IHpT9JrLS16BPRsAxfXLU3eAy53gL4nXTIkR/LTFAoF4P2MvikH9N4CXatub819nD4AGeoqeQMcHALDRcpe83h3Z3tv/55p9vcDenRyqm0sgkwAAAAGYktHRAD/AP8A/6C9p5MAAAAJcEhZcwAALiMAAC4jAXilP3YAAAAHdElNRQfoBA0UOjOwf/mRAAAAGXRFWHRDb21tZW50AENyZWF0ZWQgd2l0aCBHSU1QV4EOFwAAIABJREFUeNrtnduOJUf1Nwuz+WMzMz0nz2AwtixL8EI8OXdIICFbGGPPqXt84AzfA3TEaP/k+W66Iy7LNVWZK1fmTrciV/3ot7/97f8O4Pvvv7927dm
